exports.directoryReducer=function(e,r){if(!e)return new exports.DirectoryState;var t=exports.constants.actionTypes;switch(r.type){case t.LOAD_GENDERS_REQUEST:return e.setIn(["genders","list","isFetching"],!0);case t.LOAD_GENDERS_SUCCESS:return e.setIn(["genders","list","dataSource","data"],r.payload);case t.LOAD_GENDERS_ERROR:return e.setIn(["genders","list","error"],r.payload);case t.LOAD_RACES_REQUEST:return e.setIn(["races","list","isFetching"],!0);case t.LOAD_RACES_SUCCESS:return e.setIn(["races","list","dataSource","data"],r.payload);case t.LOAD_RACES_ERROR:return e.setIn(["races","list","error"],r.payload)}return e};